import React from "react";
import "./Cart.css"; 
import Box from "@mui/material/Box";
import { Card, CardContent, Typography } from "@mui/material";

function Cart() {
  return (
    <div>
      <h1>Cart</h1>
      <h3>TO DO LIST</h3>
      <Box sx={{ display: "flex", width: "100%", justifyContent: "space-between" }}>
        <Card className="card" sx={{width:'5rem'}}>
          <CardContent>
            <Typography>Task pending</Typography>
          </CardContent>
        </Card>
        <Card className="card">
          <CardContent>
            <Typography>Task Completed</Typography>
          </CardContent>
        </Card>
        <Card className="card">
          <CardContent>
            <Typography>Add Task</Typography>
          </CardContent>
        </Card>
      </Box>
    </div>
  );
}

export default Cart;
